    "id": 1,
    "title": "El universo (que otros llaman la Biblioteca) se compone de un número indefinido, y tal vez infinito, de galerías hexagonales.",
    "body": "La Biblioteca es ilimitada y periódica. Si un eterno viajero la recorriera en cualquier dirección, comprobaría al cabo de los siglos que los mismos volúmenes se repiten en el mismo desorden (que, repetido, sería un orden: el Orden)."
}

